(652, 27, 'Ponte Vecchio', 'Il Ponte Vecchio di Firenze è un vero e proprio gioiello architettonico e storico situato nel cuore della città. Con i suoi edifici medievali e le botteghe d\'arte che lo abitano, questo ponte offre un\'esperienza unica e indimenticabile per chiunque lo visiti.\n\nLa sua costruzione risale al 1345 e da allora è stato il punto di riferimento per la vita economica e commerciale di Firenze. In passato, il ponte ospitava macellai e salumieri, ma oggi è conosciuto soprattutto per le sue botteghe d\'oro e gioielli, che attirano visitatori da tutto il mondo.\n\nCamminare sul Ponte Vecchio è un\'esperienza che offre una vista panoramica mozzafiato sulla città e sul fiume Arno. La sensazione di essere circondati dalla storia e dalla bellezza di Firenze è indescrivibile. È anche possibile godere di un\'atmosfera tranquilla e romantica, lontana dalla folla del centro storico.\n\nInoltre, le botteghe presenti sul ponte offrono un\'esperienza di shopping unica. È possibile ammirare e acquistare gioielli e opere d\'arte create da artigiani locali, rendendo il Ponte Vecchio un luogo perfetto per chi ama l\'arte e i prodotti di qualità.\n\nIn definitiva, il Ponte Vecchio di Firenze è una tappa obbligata per chiunque visiti la città. La sua bellezza, la sua storia e la sua atmosfera unica lo rendono un luogo davvero speciale e indimenticabile. Lo consiglio vivamente a chiunque voglia immergersi nella storia e nella bellezza di Firenze.', 2, NULL, NULL, '2023-02-09', 2500, 1, NULL, 'image', NULL, '/storage/file/117/collections/27/items', '/storage/file/117/collections/27/itemsT3RvcDNzdGF6b2RSU2VmSVkrUitZMjU1VTV1K2xJYjdxRkhlMWVoMnNOZVZTYVFleTR3TzBCU0RtQmZDS3daM1owbVplYVJNNjE2Nk5NaHRneXRHR0E9PQ==', '/storage/file/117/collections/27/items/jFe5M6ZICESM31oGnPsKg51bvmMBaNFPG02qvaSI.jpg', NULL, NULL, NULL, NULL, '/storage/file/117/collections/27/items/jFe5M6ZICESM31oGnPsKg51bvmMBaNFPG02qvaSI.jpg', 0, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 